import "./App.css";
import MemberPage from "./components/MemberPage";
import ConnectPage from "./pages/connect_page";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
            <Routes>
              <Route exact path="/memberpage" element={<ConnectPage /> } />
              <Route exact path="/memberpage" element={<MemberPage />} />
            </Routes>
          </Router>
    </div>
  );
}

export default App;
